"""#GoogLeNet
Contribution:

1.broaden the breadth of the network

2.use auxiliary classifier
![GoogLeNet.png](data:image/png;base64,)
![image.png](data:image/png;base64,)
"""

#GoogLeNet(2014)
# 判斷RGB是在矩陣中的第幾個元素?
if K.image_data_format() == 'channels_first':
    input_shape = (3, img_width, img_height)
else:
    input_shape = (img_width, img_height, 3)

def Conv2d_BN(x, nb_filter, kernel_size, padding='same', strides=(1, 1), name=None):
  if name is not None:
    bn_name = name + '_bn'
    conv_name = name + '_conv'
  else:
    bn_name = None
    conv_name = None

  x = Conv2D(nb_filter, kernel_size, padding=padding, strides=strides, activation='relu', name=conv_name)(x)
  x = BatchNormalization(axis=3, name=bn_name)(x)
  return x

def Inception(x, nb_filter):
  branch1x1 = Conv2d_BN(x, nb_filter, (1, 1), padding='same', strides=(1, 1), name=None)

  branch3x3 = Conv2d_BN(x, nb_filter, (1, 1), padding='same', strides=(1, 1), name=None)
  branch3x3 = Conv2d_BN(branch3x3, nb_filter, (3, 3), padding='same', strides=(1, 1), name=None)

  branch5x5 = Conv2d_BN(x, nb_filter, (1, 1), padding='same', strides=(1, 1), name=None)
  branch5x5 = Conv2d_BN(branch5x5, nb_filter, (1, 1), padding='same', strides=(1, 1), name=None)

  branchpool = MaxPooling2D(pool_size=(3, 3), strides=(1, 1), padding='same')(x)
  branchpool = Conv2d_BN(branchpool, nb_filter, (1, 1), padding='same', strides=(1, 1), name=None)

  x = concatenate([branch1x1, branch3x3, branch5x5, branchpool], axis=3)

  return x

def GoogLeNet():
  input = Input(shape=input_shape)
  # padding = 'same'，填充為(步長-1）/2,還可以用ZeroPadding2D((3,3))
  x = Conv2d_BN(input, 64, (7, 7), strides=(2, 2), padding='same')
  x = MaxPooling2D(pool_size=(3, 3), strides=(2, 2), padding='same')(x)
  x = Conv2d_BN(x, 192, (3, 3), strides=(1, 1), padding='same')
  x = MaxPooling2D(pool_size=(3, 3), strides=(2, 2), padding='same')(x)
  x = Inception(x, 64)  # 256
  x = Inception(x, 120)  # 480
  x = MaxPooling2D(pool_size=(3, 3), strides=(2, 2), padding='same')(x)
  x = Inception(x, 128)  # 512
  x = Inception(x, 128)
  x = Inception(x, 128)
  x = Inception(x, 132)  # 528
  x = Inception(x, 208)  # 832
  x = MaxPooling2D(pool_size=(3, 3), strides=(2, 2), padding='same')(x)
  x = Inception(x, 208)
  x = Inception(x, 256)  # 1024
  x = AveragePooling2D(pool_size=(7, 7), strides=(7, 7), padding='same')(x)
  x = Dropout(0.4)(x)
  x = Dense(1000, activation='relu')(x)
  x = Dense(1, activation='sigmoid')(x)
  model = Model(input, x, name='inception')
  model.compile(loss='binary_crossentropy', optimizer='sgd', metrics=['accuracy'])
  model.summary()

"""#ResNet50
Contribution:

1.use residual block
![ResNet50.png](data:image/png;base64,)
"""

#ResNet50(2015)
# 判斷RGB是在矩陣中的第幾個元素?
if K.image_data_format() == 'channels_first':
    input_shape = (3, img_width, img_height)
else:
    input_shape = (img_width, img_height, 3)

def Conv2d_BN(x, nb_filter,kernel_size, strides=(1,1), padding='same',name=None):  
    if name is not None:  
        bn_name = name + '_bn'  
        conv_name = name + '_conv'  
    else:  
        bn_name = None  
        conv_name = None  
  
    x = Conv2D(nb_filter,kernel_size,padding=padding,strides=strides,activation='relu',name=conv_name)(x)  
    x = BatchNormalization(axis=3, name=bn_name)(x)  
    return x  
  
def Conv_Block(input,nb_filter,kernel_size,strides=(1,1), with_conv_shortcut=False):  
    x = Conv2d_BN(input,nb_filter=nb_filter[0],kernel_size=(1,1),strides=strides,padding='same')  
    x = Conv2d_BN(x, nb_filter=nb_filter[1], kernel_size=(3,3), padding='same')  
    x = Conv2d_BN(x, nb_filter=nb_filter[2], kernel_size=(1,1), padding='same')  
    if with_conv_shortcut:  
        shortcut = Conv2d_BN(input,nb_filter=nb_filter[2],strides=strides,kernel_size=kernel_size)  
        x = add([x,shortcut])  
        return x  
    else:  
        x = add([x,input])  
        return x  
  
input = Input(shape=input_shape)  
x = ZeroPadding2D((3,3))(input)  
x = Conv2d_BN(x,nb_filter=64,kernel_size=(7,7),strides=(2,2),padding='valid')  
x = MaxPooling2D(pool_size=(3,3),strides=(2,2),padding='same')(x)  
  
x = Conv_Block(x,nb_filter=[64,64,256],kernel_size=(3,3),strides=(1,1),with_conv_shortcut=True)  
x = Conv_Block(x,nb_filter=[64,64,256],kernel_size=(3,3))  
x = Conv_Block(x,nb_filter=[64,64,256],kernel_size=(3,3))  
  
x = Conv_Block(x,nb_filter=[128,128,512],kernel_size=(3,3),strides=(2,2),with_conv_shortcut=True)  
x = Conv_Block(x,nb_filter=[128,128,512],kernel_size=(3,3))  
x = Conv_Block(x,nb_filter=[128,128,512],kernel_size=(3,3))  
x = Conv_Block(x,nb_filter=[128,128,512],kernel_size=(3,3))  
  
x = Conv_Block(x,nb_filter=[256,256,1024],kernel_size=(3,3),strides=(2,2),with_conv_shortcut=True)  
x = Conv_Block(x,nb_filter=[256,256,1024],kernel_size=(3,3))  
x = Conv_Block(x,nb_filter=[256,256,1024],kernel_size=(3,3))  
x = Conv_Block(x,nb_filter=[256,256,1024],kernel_size=(3,3))  
x = Conv_Block(x,nb_filter=[256,256,1024],kernel_size=(3,3))  
x = Conv_Block(x,nb_filter=[256,256,1024],kernel_size=(3,3))  
  
x = Conv_Block(x,nb_filter=[512,512,2048],kernel_size=(3,3),strides=(2,2),with_conv_shortcut=True)  
x = Conv_Block(x,nb_filter=[512,512,2048],kernel_size=(3,3))  
x = Conv_Block(x,nb_filter=[512,512,2048],kernel_size=(3,3))  
x = AveragePooling2D(pool_size=(5,5))(x)  
x = Flatten()(x)  
x = Dense(1,activation='sigmoid')(x)  
  
model = Model(inputs=input,outputs=x)  
sgd = SGD(decay=0.0001,momentum=0.9)  
model.compile(loss='binary_crossentropy',optimizer=sgd,metrics=['accuracy'])  
model.summary()

